import React, { useState } from 'react';
import axios from 'axios';
import './ImportCSV.css';
import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';
import Charts from './ChartComponent';

function ImportCSV() {
  const [trainData, setTrainData] = useState(null);
  const [trainingSize, setTrainingSize] = useState(0.8);
  const [trainDataInfo, setTrainDataInfo] = useState(null);
  const [trainDataUploaded, setTrainDataUploaded] = useState(false);

  const [testData, setTestData] = useState(null);
  const [testDataInfo, setTestDataInfo] = useState(null);
  const [testDataUploaded, setTestDataUploaded] = useState(false);

  const [targetVariable, setTargetVariable] = useState('');
  const [savedVariable, setSavedVariable] = useState('');
  const [selectedColumns, setSelectedColumns] = useState([]);

  const handleTrainDataUpload = (event) => {
    setTrainData(event.target.files[0]);
  };

  const handleTrainingSizeChange = (value) => {
    setTrainingSize(value);
  };

  const handleTestDataUpload = (event) => {
    setTestData(event.target.files[0]);
  };

  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', trainData);
    formData.append('training_size', trainingSize);

    axios
      .post('/upload/train_data', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setTrainDataInfo(response.data);
          setTrainDataUploaded(true);
        }
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const handleTestData = () => {
    const formData = new FormData();
    formData.append('file', testData);

    axios
      .post('/upload/test_data', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setTestDataInfo(response.data);
          setTestDataUploaded(true);
        }
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const handlePreprocessData = () => {
    axios
      .post('/trim_data', { trainingSize, targetVariable })
      .then((response) => {
        console.log(response.data);

        window.alert('Trimmed Data Saved at Backend!');
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const handleSaveVariable = () => {
    setSavedVariable(targetVariable);
    setTargetVariable('');
  };

  const handleMultiselection = () => {
    axios
      .post('/multiselection', { columns: selectedColumns })
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setSelectedColumns(response.data.selected_columns);
        }
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div className="container">
      <div className="section">
        <h2>Train Data</h2>
        <div className="slider-container">
          <p style={{ fontFamily: 'inherit', fontSize: '16px' }}>Training Size: {trainingSize}</p>
          <Slider
            min={0.1}
            max={1}
            step={0.1}
            value={trainingSize}
            onChange={handleTrainingSizeChange}
          />
        </div>
        <div className="input-section">
          <input type="file" onChange={handleTrainDataUpload} />
          <button onClick={handleGraphUpload}>Upload and Preprocess</button>
        </div>

        {trainDataUploaded && trainDataInfo && (
          <div className="result">
            <p>Data Rows: {trainDataInfo.rows}</p>
            <p>Data Columns: {trainDataInfo.columns.length}</p>
            <p>Target Variable:</p>
            <input
              type="text"
              value={targetVariable}
              onChange={(e) => setTargetVariable(e.target.value)}
            />
            <button onClick={handleSaveVariable} style={{ backgroundColor: '#defde0', color: 'black' }}>Submit</button>

            {savedVariable && <p>Saved Variable: {savedVariable}</p>}
          </div>
        )}
      </div>

      <div className="section">
        <h2>Test Data</h2>
        <div className="input-section">
          <input type="file" onChange={handleTestDataUpload} />
          <button onClick={handleTestData}>Upload</button>
        </div>
        {testDataInfo && (
          <div className="result">
            <p>Data Rows: {testDataInfo.rows}</p>
            <p>Data Columns: {testDataInfo.columns.length}</p>
          </div>
        )}
        {testDataUploaded && <h6>Test Data Uploaded</h6>}
      </div>

      <div className="graphs-container">
        {trainDataUploaded && (
          <div className="graph-section">
            <Charts />
          </div>
        )}
      </div>

      <button className="button" onClick={handlePreprocessData}>
        Trim Data
      </button>

      <div className="section">
        <h2>Multi-Selection</h2>
        {trainDataUploaded && trainDataInfo && (
          <div className="result">
            <p>Select Columns:</p>
            {trainDataInfo.columns.length > 0 && (
              <select
                multiple
                value={selectedColumns}
                onChange={(e) => setSelectedColumns(Array.from(e.target.selectedOptions, option => option.value))}
              >
                {trainDataInfo.columns.map((column) => (
                  <option key={column} value={column}>{column}</option>
                ))}
              </select>
            )}
            <button onClick={handleMultiselection}>Apply</button>
          </div>
        )}
      </div>
    </div>
  );
}

export default ImportCSV;
